signatures: >-
  executeAgentCommand(agentDirectoryPath:string, command:string) :
  Promise.<string> - Executes a faqtiv cli command in the specified agent
  directory and returns a promise that resolves with the command's stdout output
  or stderr if stdout is empty.

  fetchYamlApiSpec(apiUrl:string) : Promise.<Object> - Fetches the API spec from
  the given URL and parses it using Swagger-Parser, returning a promise that
  resolves with the parsed API spec object containing the entire structure of
  the API including paths, definitions, parameters, responses, and security
  configurations.
